import { createSlice } from "@reduxjs/toolkit";



const initialState = {
    newClient: {}
}


export const newClientSlice = createSlice({
    name: 'newClient',
    initialState,
    reducers:{
        createNewClient: (state,action) => {

            state.newClient = action.payload.newClient

        }
    }

})

export const {createNewClient} = newClientSlice.reducer;
